#include <string>
#include "../third/sqlite/sqlite3.h"
#include "../third/utils/log.h"
#include "../third/utils/utils.h"

using namespace std;


sqlite3 *SQLITE_Init(const string &path) {
    sqlite3 *sqliteConfigDB;
    int rv = sqlite3_open(path.c_str(), &sqliteConfigDB);
    if (rv == SQLITE_OK) {
        logi("open db!");
        return sqliteConfigDB;
    }
    loge("open db error!");
    sqlite3_close(sqliteConfigDB);
    return nullptr;
}

bool SQLITE_SaveDeviceConfig(sqlite3 *db, const string &name, const string &type,
                             const string &password) {
    char *bigBuff = new char[10240];
    defer([&]() {
        delete[] bigBuff;
    });
    sqlite3_snprintf(10240, bigBuff,
                     "REPLACE into accounts(name,type,password) VALUES('%q','%q','%q')",
                     name.c_str(), type.c_str(), password.c_str());
    int ret = sqlite3_exec(db, bigBuff, nullptr, nullptr, nullptr);
    if (ret != SQLITE_OK) {
        loge("db data error! %s", sqlite3_errmsg(db));
        return false;
    }
    return true;
}

void runSql(sqlite3 *db, const string &sql) {
    auto sqls = string_split(sql, "\n");
    for (auto item: sqls) {
        if (item.length() < 10) {
            continue;
        }
        int ret = sqlite3_exec(db, item.c_str(), nullptr, nullptr, nullptr);
        if (ret != SQLITE_OK) {
            loge("db data error! %s", sqlite3_errmsg(db));
        }
    }
}

